import React, { useEffect, useState } from "react";
import Footer from "../../components/Footer/Footer";
import Navbar from "../../components/Navbar/Navbar";
import "./adviceStyle.css";
import HomeImage from '../../assets/adviceBG.png';
import CardImage from '../../assets/adviceBG.png';

const AdvicePage = () => {
  return (
    <div className="advice">
      <Navbar />

      <div className="advice-content">
        <div className="advice-image">
          <img src="" alt="" />
        </div>

        <div className="advice-title">Helpful tips from our team</div>

        <div className="advice-list">
          <div className="advice-card">
            <div className="advice-card-image">
              <img src="" alt="" />
            </div>

            <div className="advice-card-text">
              <div className="advice-card-title">
                How to organize your wedding event
              </div>
              <div className="advice-card-body">
                5 advice to make perfect wedding
              </div>
            </div>
          </div>
        </div>
      </div>

      <Footer />
    </div>
  );
};

export default AdvicePage;
